import {React} from "react";

export default function Footer() {
    
    return (
        <div class="container">
            <footer class="py-3 my-4">
                <p>+7(495)777</p>
                <p class="text-center text-muted">© 2022 Company, Inc</p>
            </footer>
        </div>
    )
}
